                if (calcTypeCombo.getSelectedIndex() == 2) {
                    boundaryCondCombo.setSelectedIndex(4);
                    potential.setEnabled(true);
                } else {
                    if (boundaryCondCombo.getSelectedIndex() == 4) {
                        boundaryCondCombo.setSelectedIndex(0);
                        potential.setEnabled(false);
