            throw new NullPointerException();
        int length = xArr.length;
        if (yArr.length != length)
            throw new ArrayIndexOutOfBoundsException();
        for (int i = 0; i < length; ++i) {
            data.add(new PlotDatum(xArr[i], yArr[i], connectFlg, symbol));
        }
    }

