     *  Collection.
     *
     *  @param data  An Collection containing PlotDatum objects.
     */
    public PlotRun(Collection run) {
        if (run instanceof PlotRun)
            data.addAll(run);
        else {
            for (Iterator i = run.iterator(); i.hasNext(); ) {
                Object obj = i.next();
                if (obj instanceof PlotDatum)
                    data.add(obj);
            }
        }
